sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new JenkinsUtils().trimStringInputs(inputs);
    outputs.node_name = inputs.node_name;
    var node_description = inputs.node_description;
    if (inputs.number_of_executors >= 1)
        var number_of_executors = inputs.number_of_executors;
    else
        new JenkinsUtils().throwError('create_node');

    var remote_root_directory = inputs.remote_root_directory;
    var label = inputs.label;
    var usage = inputs.usage;

    var payload = {
        "numExecutors": number_of_executors,
        "remoteFS": remote_root_directory,
        "mode": usage,
        "launcher": {
            "stapler-class": "hudson.slaves.JNLPLauncher",
            "class": "hudson.slaves.JNLPLauncher"
        }
    }

    if (node_description) {
        payload["nodeDescription"] = node_description;
    }
    if (label) {
        payload["labelString"] = label;
    }

    outputs.json = JSON.stringify(payload);
})(inputs, outputs);

